import React from 'react';

function AddRoom({ room, onRemoveRoom, onRoomChange }) {
  return (
    <div className="flex items-start gap-3 mb-4">
      <div className="flex-1">
        <label htmlFor={`room-${room.id}`} className="block mb-2">Room {room.id}'s Specialization</label>
        <input
          id={`room-${room.id}`}
          type="text"
          className="w-full p-2 border rounded-md"
          value={room.specialization}
          onChange={(e) => onRoomChange(room.id, e.target.value)}
          placeholder="List of Specialties that can be practiced in the room"
        />
      </div>
      <button
        type="button"
        className="mt-4 gap-3 px-4 py-3 bg-red-500 text-white rounded-full hover:bg-red-600"
        onClick={() => onRemoveRoom(room.id)}
      >
        Remove Room
      </button>
    </div>
  );
}

export default AddRoom;
